import React from 'react'
import {GoogleLogout} from 'react-google-login';
import {CLIENT_ID} from './constants';

const SignOutAuth = () => {
    const onSuccess = () => {
       alert('Logout made successfully ')
    }

    return (
        <div>
        <GoogleLogout
        clientId={CLIENT_ID}
        buttonText="Logout"
        onLogoutSuccess={onSuccess}
        />
        </div>
    )
}

export default SignOutAuth
